import { addCommaInData } from '../data-utility'
const renderStatus = (record) => {
  if (record.status === '1') {
    return <p style={{ color: green[6] }}>Active</p>
  } else if (record.status === '2') {
    return <p style={{ color: gold[6] }}>Pending</p>
  } else {
    return null
  }
}

export const columnPartnerList = [
  {
    title: 'No.',
    dataIndex: 'no',
  },
  {
    title: 'Channel',
    dataIndex: 'channel',
  },
  {
    title: 'Txn Limit',
    dataIndex: 'txn_limit',
  },
  {
    title: 'Daily Limit',
    dataIndex: 'daily_limit',
    render: (text, record) => addCommaInData(text, true)
  },
  {
    title: 'Action',
    dataIndex: 'operation',
  },
]

export const columnProductList = (props) => {

  return [
    {
      dataIndex: 'operation',
      render: (text, record, index) =>
        renderStatus(record, index)
    },
    {
      title: 'Product_Code',
      dataIndex: 'product_type',
      width: '5%',
      editable: true,
      render: (text, record) => addCommaInData(text)
    },
    {
      title: 'Product_Description',
      dataIndex: 'product_description',
      editable: true,
      render: (text, record) => addCommaInData(text)
    },
    {
      title: 'All-Channel Txn Limit',
      dataIndex: 'transaction_limit',
      editable: true,
      render: (text, record) => addCommaInData(text, true)
    },
    {
      title: 'All-Channel Daily Limit',
      dataIndex: 'daily_limit',
      editable: true,
      render: (text, record) => addCommaInData(text, true)
    },
    {
      title: 'Specific Channel Limit',
      dataIndex: 'Specific',
      // editable: true,
      render: (text, record) => addCommaInData(text)
    },
    {
      title: 'Action',
      dataIndex: 'operation',
      render: (text, record, index) =>
        renderActionAddDeleteHandler(record, index)
    },
  ];
}
